export const addStudent = (id, fName, city) => {
    return {
        type: "ADD_STUDENT",
        data: {
            id, fName, city
        }
    }
}
export const deleteStudentByID = (id) => {
    return {
        type: "ADD_STUDENT",
        data: {
            id, fName, city
        }
    }
}
